LW4_3 = [0.62200286108647617755 -0.54788070554753764974 0.60695864641540098194 -0.067388342084433977552 0.23511636576406530486 -0.60111416129788708407 0.44608552339038121115 0.42499933346660190292 0.17338351312160857343 0.77006557503835082468 0.56021089673502622031 0.53228392985009131966 -0.1145207154487247192 -0.30512562813354565661 -0.42461418576735715513 0.5664527890051274106 0.35228461919761067112 -0.58639185627401613221 0.25865950151717426175 0.68357929209052392672 -0.087914601553300428249 -0.31753599052538855618 0.14557882664294552466 0.67271192214007979882 -0.56679548820460112779 -0.25738510823329485699 -0.06284513827972734723 -0.15370645087599310585 -0.32849332018950783141 0.042013182125073635087];

% Output 1
y1_step1.ymin = -1;
y1_step1.gain = 0.333333333333333;
y1_step1.xoffset = 3;

% ===== SIMULATION ========

% Format Input Arguments
isCellX = iscell(X);
if ~isCellX
  X = {X};
end

% Dimensions
TS = size(X,2); % timesteps
if ~isempty(X)
  Q = size(X{1},2); % samples/series
else
  Q = 0;
end

% Allocate Outputs
Y = cell(1,TS);

% Time loop
for ts=1:TS

    % Input 1
    Xp1 = mapminmax_apply(X{1,ts},x1_step1);
    
    % Layer 1
    a1 = tansig_apply(repmat(b1,1,Q) + IW1_1*Xp1);
    
    % Layer 2
    a2 = tansig_apply(repmat(b2,1,Q) + LW2_1*a1);
    
    % Layer 3
    a3 = tansig_apply(repmat(b3,1,Q) + LW3_2*a2);
    
    % Layer 4
    a4 = repmat(b4,1,Q) + LW4_3*a3;
    
    % Output 1
    Y{1,ts} = mapminmax_reverse(a4,y1_step1);
end

% Final Delay States
Xf = cell(1,0);
Af = cell(4,0);

% Format Output Arguments
if ~isCellX
  Y = cell2mat(Y);
end
end

% ===== MODULE FUNCTIONS ========

% Map Minimum and Maximum Input Processing Function
function y = mapminmax_apply(x,settings)
  y = bsxfun(@minus,x,settings.xoffset);
  y = bsxfun(@times,y,settings.gain);
  y = bsxfun(@plus,y,settings.ymin);
end

% Sigmoid Symmetric Transfer Function
function a = tansig_apply(n,~)
  a = 2 ./ (1 + exp(-2*n)) - 1;
end

% Map Minimum and Maximum Output Reverse-Processing Function
function x = mapminmax_reverse(y,settings)
  x = bsxfun(@minus,y,settings.ymin);
  x = bsxfun(@rdivide,x,settings.gain);
  x = bsxfun(@plus,x,settings.xoffset);
end
